import ReactDOM from 'react-dom'
import { UserSignUp } from '../../services/authentication/authentication'

const SignUp = () => {

    console.log('enter sign up')

    let username;
    let email;
    let password;
    let rePassword;

    const handleSubmit = () => {
        if (password === rePassword) {
            const data = {
                username: username,
                email: email,
                password: password
            }
            console.log('enter')
            UserSignUp(data).then((response) => {
                if (response.status === "error") {
                    console.log('error')
                }
                else {
                    console.log('success')
                }
            })
                .catch((error) => {
                    console.log(error)
                })
        }
    }

    let content = (
        <div>
            <h3>Sign up</h3>
            <div>
                <form action="">
                    <label>Username</label>
                    <input type="text" ref={(input) => username = input} name="username" />
                    <label>Email</label>
                    <input type="text" ref={(input) => email = input} name="email" />
                    <label>Password</label>
                    <input type="password" ref={(input) => password = input} name="password" />
                    <label>Retype password</label>
                    <input type="password" ref={(input) => rePassword = input} name="repassword" />
                    <input type="submit" value="Sign up" onClick={handleSubmit} />
                </form>
            </div>
        </div>
    );
    return content;
}

export default SignUp
